import React from "react";
import styled from "styled-components";

function LoginForm() {
  return (
    <FormContainer>
      <FormContent>
        <Title>Welcome to Wildlife Community</Title>
        <form>
          <InputGroup>
            <Label htmlFor="email">Email</Label>
            <Input type="email" id="email" aria-label="Email" />
          </InputGroup>
          <InputGroup>
            <Label htmlFor="password">Password</Label>
            <Input type="password" id="password" aria-label="Password" />
          </InputGroup>
          <ForgotPassword>Forget your password</ForgotPassword>
          <SubmitButton type="submit">Log in</SubmitButton>
        </form>
      </FormContent>
    </FormContainer>
  );
}

const FormContainer = styled.section`
  display: flex;
  flex-direction: column;
  line-height: normal;
  width: 55%;
  margin-left: 0;

  @media (max-width: 991px) {
    width: 100%;
  }
`;

const FormContent = styled.div`
  display: flex;
  margin-top: 30px;
  flex-direction: column;
  font-size: 16px;
  font-weight: 400;

  @media (max-width: 991px) {
    max-width: 100%;
    margin-top: 40px;
  }
`;

const Title = styled.h2`
  color: #333;
  padding: 0 20px;
  font: 600 32px Fira Sans, sans-serif;
  margin-bottom: 36px;

  @media (max-width: 991px) {
    max-width: 100%;
  }
`;

const InputGroup = styled.div`
  display: flex;
  margin-bottom: 24px;
  flex-direction: column;
  color: #666;
`;

const Label = styled.label`
  font-family: Fira Sans, sans-serif;
  padding: 3px 20px 12px;

  @media (max-width: 991px) {
    max-width: 100%;
  }
`;

const Input = styled.input`
  border-radius: 12px;
  border: 1px solid rgba(102, 102, 102, 0.35);
  height: 40px;
  padding: 8px 12px;

  @media (max-width: 991px) {
    max-width: 100%;
  }
`;

const ForgotPassword = styled.a`
  font-family: Fira Sans, sans-serif;
  text-decoration: underline;
  align-self: start;
  color: #111;
  padding: 2px;
  cursor: pointer;
`;

const SubmitButton = styled.button`
  justify-content: center;
  align-items: center;
  border-radius: 32px;
  background-color: #111;
  display: flex;
  margin-top: 36px;
  font-size: 22px;
  color: #fff;
  font-weight: 500;
  text-align: center;
  padding: 19px 60px;
  border: none;
  cursor: pointer;
  font-family: Fira Sans, sans-serif;
  width: 100%;

  @media (max-width: 991px) {
    padding: 19px 20px;
  }
`;

export default LoginForm;
